import React from 'react';
import { motion } from 'framer-motion';

const Contact = () => {
  return (
    <section id="contact" className="py-20 px-6 text-center bg-black text-white">
      <h2 className="text-4xl font-serif text-primary mb-6">Contact</h2>
      <motion.p 
        className="mb-4"
        initial={{ opacity: 0 }} 
        animate={{ opacity: 1 }} 
        transition={{ duration: 1 }}
      >
        Feel free to reach out via email or LinkedIn.
      </motion.p>
      <motion.p
        initial={{ opacity: 0 }} 
        animate={{ opacity: 1 }} 
        transition={{ duration: 1.5 }}
      >
        Email: <a href="mailto:satyansh.g16@gmail.com" className="text-primary">satyansh@example.com</a>
      </motion.p>
      <motion.p 
        initial={{ opacity: 0 }} 
        animate={{ opacity: 1 }} 
        transition={{ duration: 2 }}
      >
        LinkedIn: <a href="www.linkedin.com/in/satyansh-5036" className="text-primary"></a>
      </motion.p>
    </section>
  );
};

export default Contact;
